import React from "react";
import "./App.css";

import { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Layout from "./components/shared/Layout";
import About from "./routes/About";
import Login from "./routes/Login";
import Chronoquiz from "./routes/Chronoquiz";

import UserContext from "./store/UserContext";

function App() {
  let [authenticated, setAuthenticated] = useState(false);
  let [currentUser,   setCurrentUser]   = useState(null);
  let [userToken,     setUserToken]     = useState(null);

  let userContext = {
    get: key => userContext[key][0],
    set: key => userContext[key][1],
    authenticated: [authenticated, setAuthenticated],
    currentUser:   [currentUser,   setCurrentUser],
    userToken:     [userToken,     setUserToken]
  }

  return (
    <UserContext.Provider value={userContext}>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Layout />}>
            <Route path="/about" element={<About />} />
            <Route path="/login" element={<Login />} />
            <Route path="/chronoquiz" element={<Chronoquiz />} />
          </Route>
        </Routes>
      </BrowserRouter>
    </UserContext.Provider>
  );
}

export default App;
